import Homepage from './Homepage'
import { BrowserRouter,Route,Routes } from 'react-router-dom';

function App() {
  return (
  <div>
    <BrowserRouter>
    <Routes>
   <Route path="/Homepage" element={<Homepage/>}></Route>
    </Routes>
    </BrowserRouter>

  </div>)
}

export default App;
